import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for video container with data-video-id='1'
    const videoContainerSelector = '[data-video-id="1"]';
    await page.waitForSelector(videoContainerSelector);

    // Find volume slider within the first video container
    const volumeSliderSelector = `${videoContainerSelector} input.volume-slider`;
    await page.waitForSelector(volumeSliderSelector);

    // Set volume to 50% using JavaScript evaluation
    await page.$eval(volumeSliderSelector, (slider) => {
      slider.value = 0.5;
      slider.dispatchEvent(new Event('input', { bubbles: true }));
      slider.dispatchEvent(new Event('change', { bubbles: true }));
    });

    // Wait for UI to update
    await page.waitForTimeout(1000);

    // Take screenshot after volume change
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_volume_set.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_volume_set.png'));

    // Verify volume was set correctly
    const volumeValue = await page.$eval(volumeSliderSelector, el => el.value);

    return {
      success: true,
      action: "Set first video's volume slider to 50%",
      extractedData: {
        volumeValue: volumeValue,
        videoId: '1'
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to set volume slider",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
